  qudt_Enumeration:
    class_uri: qudt:Enumeration
    conforms_to: No schema conformance document specified
    description: "<p>An enumeration is a set of literals from which a single value\
      \ is selected. Each literal can have a tag as an integer within a standard encoding\
      \ appropriate to the range of integer values. Consistency of enumeration types\
      \ will allow them, and the enumerated values, to be referred to unambiguously\
      \ either through symbolic name or encoding. Enumerated values are also controlled\
      \ vocabularies and as such need to be standardized. Without this consistency\
      \ enumeration literals can be stated differently and result in  data conflicts\
      \ and misinterpretations.</p>\u240A\u240A<p>The tags are a set of positive whole\
      \ numbers, not necessarily contiguous and having no numerical significance,\
      \ each corresponding to the associated literal identifier. An order attribute\
      \ can also be given on the enumeration elements. An enumeration can itself be\
      \ a member of an enumeration. This allows enumerations to be enumerated in a\
      \ selection. Enumerations are also subclasses of <em>Scalar Datatype</em>. This\
      \ allows them to be used as the reference of a datatype specification.</p>"
    is_a: nd584c290b5bb4622b066da892c701147b76
    name: qudt_Enumeration
    source: http://qudt.org/schema/qudt
    title: Enumeration
