  qudt_OrdinalScale:
    class_uri: qudt:OrdinalScale
    conforms_to: No schema conformance document specified
    description: The ordinal type allows for rank order (1st, 2nd, 3rd, etc.) by which
      data can be sorted, but still does not allow for relative degree of difference
      between them. Examples include, on one hand, dichotomous data with dichotomous
      (or dichotomized) values such as 'sick' vs. 'healthy' when measuring health,
      'guilty' vs. 'innocent' when making judgments in courts, 'wrong/false' vs. 'right/true'
      when measuring truth value, and, on the other hand, non-dichotomous data consisting
      of a spectrum of values, such as 'completely agree', 'mostly agree', 'mostly
      disagree', 'completely disagree' when measuring opinion.
    is_a: nd584c290b5bb4622b066da892c701147b93
    name: qudt_OrdinalScale
    see_also:
