  qudt_QuantityKind:
    class_uri: qudt:QuantityKind
    conforms_to: No schema conformance document specified
    description: A <b>Quantity Kind</b> is any observable property that can be  measured
      and quantified numerically. Familiar examples include physical properties such
      as length, mass, time, force, energy, power, electric charge, etc. Less familiar
      examples include currency, interest rate, price to earning ratio, and information
      capacity.
    is_a: nd584c290b5bb4622b066da892c701147b146
    name: qudt_QuantityKind
    source: http://qudt.org/schema/qudt
    title: Quantity Kind
  qudt_QuantityKindDimensionVector:
    class_uri: qudt:QuantityKindDimensionVector
    conforms_to: No schema conformance document specified
    description: "<p class=\"lm-para\">A  <em>Quantity Kind Dimension Vector</em>\
      \ describes the dimensionality of a quantity kind in the context of a system\
      \ of units. In the SI system of units, the dimensions of a quantity kind are\
      \ expressed as a product of the basic physical dimensions mass ($M$), length\
      \ ($L$), time ($T$) current ($I$), amount of substance ($N$), luminous intensity\
      \ ($J$) and absolute temperature ($\\theta$) as $dim \\, Q = L^{\\alpha} \\\
      , M^{\\beta} \\, T^{\\gamma} \\, I ^{\\delta} \\, \\theta ^{\\epsilon} \\, N^{\\\
      eta} \\, J ^{\\nu}$.</p>\u240A\u240A<p class=\"lm-para\">The rational powers\
      \ of the dimensional exponents, $\\alpha, \\, \\beta, \\, \\gamma, \\, \\delta,\
      \ \\, \\epsilon, \\, \\eta, \\, \\nu$, are positive, negative, or zero.</p>\u240A\
      \u240A<p class=\"lm-para\">For example, the dimension of the physical quantity\
      \ kind $\\it{speed}$ is $\\boxed{length/time}$, $L/T$ or $LT^{-1}$, and the\
      \ dimension of the physical quantity kind force is $\\boxed{mass \\times acceleration}$\
      \ or $\\boxed{mass \\times (length/time)/time}$, $ML/T^2$ or $MLT^{-2}$ respectively.</p>"
    is_a: nd584c290b5bb4622b066da892c701147b157
    name: qudt_QuantityKindDimensionVector
    source: http://qudt.org/schema/qudt
    title: Quantity Kind Dimension Vector
  qudt_QuantityKindDimensionVector_CGS:
