  qudt_RatioScale:
    class_uri: qudt:RatioScale
    conforms_to: No schema conformance document specified
    description: The ratio type takes its name from the fact that measurement is the
      estimation of the ratio between a magnitude of a continuous quantity and a unit
      magnitude of the same kind (Michell, 1997, 1999). A ratio scale possesses a
      meaningful (unique and non-arbitrary) zero value. Most measurement in the physical
      sciences and engineering is done on ratio scales. Examples include mass, length,
      duration, plane angle, energy and electric charge. In contrast to interval scales,
      ratios are now meaningful because having a non-arbitrary zero point makes it
      meaningful to say, for example, that one object has "twice the length" of another
      (= is "twice as long"). Very informally, many ratio scales can be described
      as specifying "how much" of something (i.e. an amount or magnitude) or "how
      many" (a count). The Kelvin temperature scale is a ratio scale because it has
      a unique, non-arbitrary zero point called absolute zero.
    is_a: qudt_Scale
    name: qudt_RatioScale
    see_also:
    - http://qudt.org/schema/qudt/IntervalScale
    - http://qudt.org/schema/qudt/NominalScale
    - http://qudt.org/schema/qudt/OrdinalScale
    source: http://qudt.org/schema/qudt
    title: Ratio scale
