  qudt_SystemOfQuantityKinds:
    class_uri: qudt:SystemOfQuantityKinds
    conforms_to: No schema conformance document specified
    description: "A system of quantity kinds is a set of one or more quantity kinds\
      \ together with a set of zero or more algebraic equations that define relationships\
      \ between quantity kinds in the set. In the physical sciences, the equations\
      \ relating quantity kinds are typically physical laws and definitional relations,\
      \ and constants of proportionality. Examples include Newton\u2019s First Law\
      \ of Motion, Coulomb\u2019s Law, and the definition of velocity as the instantaneous\
      \ change in position.  In almost all cases, the system identifies a subset of\
      \ base quantity kinds. The base set is chosen so that all other quantity kinds\
      \ of interest can be derived from the base quantity kinds and the algebraic\
      \ equations. If the unit system is explicitly associated with a quantity kind\
      \ system, then the unit system must define at least one unit for each quantity\
      \ kind.  From a scientific point of view, the division of quantities into base\
      \ quantities and derived quantities is a matter of convention."
    is_a: nd584c290b5bb4622b066da892c701147b185
    name: qudt_SystemOfQuantityKinds
    source: http://qudt.org/schema/qudt
    title: System of Quantity Kinds
  qudt_SystemOfUnits:
    class_uri: qudt:SystemOfUnits
    conforms_to: No schema conformance document specified
    description: A system of units is a set of units which are chosen as the reference
      scales for some set of quantity kinds together with the definitions of each
      unit. Units may be defined by experimental observation or by proportion to another
      unit not included in the system. If the unit system is explicitly associated
      with a quantity kind system, then the unit system must define at least one unit
      for each quantity kind.
    is_a: nd584c290b5bb4622b066da892c701147b194
    name: qudt_SystemOfUnits
    source: http://qudt.org/schema/qudt
    title: System of Units
