    description: No slot (predicate) description specified
    examples:
    - object:
        example_object: '<p class="lm-para">The QUDT, or "Quantity, Unit, Dimension
          and Type" schema defines the base classes properties, and restrictions used
          for modeling physical quantities, units of measure, and their dimensions
          in various measurement systems. The goal of the QUDT ontology is to provide
          a unified model of, measurable quantities, units for measuring different
          kinds of quantities, the numerical values of quantities in different units
          of measure and the data structures and data types used to store and manipulate
          these objects in software.</p>


          <p class="lm-para">Except for unit prefixes, all units are specified in
          separate vocabularies. Descriptions are provided in both HTML and LaTeX
          formats. A quantity is a measure of an observable phenomenon, that, when
          associated with something, becomes a property of that thing; a particular
          object, event, or physical system. </p>


          <p class="lm-para">A quantity has meaning in the context of a measurement
          (i.e. the thing measured, the measured value, the accuracy of measurement,
          etc.) whereas the underlying quantity kind is independent of any particular
          measurement. Thus, length is a quantity kind while the height of a rocket
          is a specific quantity of length; its magnitude that may be expressed in
          meters, feet, inches, etc.  Or, as stated at Wikipedia, in the language
          of measurement, quantities are quantifiable aspects of the world, such as
          time, distance, velocity, mass, momentum, energy, and weight, and units
          are used to describe their measure. Many of these quantities are related
          to each other by various physical laws, and as a result the units of some
          of the quantities can be expressed as products (or ratios) of powers of
          other units (e.g., momentum is mass times velocity and velocity is measured
          in distance divided by time).</p>'
        example_object_type: rdf_HTML
        example_predicate: dct:description
        example_subject: vaem:#GMD_QUDT-SCHEMA
        example_subject_type: vaem_#GraphMetaData
    - object:
        example_object: "\n  A set of numbers is called countably infinite if there\
          \ is a way to enumerate them. \n  Formally this is done with a bijection\
          \ function that associates each number in the set with exactly one of the\
          \ positive integers.\n  The set of all fractions is also countably infinite.\n\
          \  In other words, any set $X$ that has the same cardinality as the set\
          \ of the natural numbers,\n   or $| X | \\; =  \\; | \\mathbb N | \\; =\
          \ \\; \\aleph0$, is said to be a countably infinite set.\n  "
        example_object_type: qudt_LatexString
        example_predicate: dct:description
        example_subject: qudt:CT_COUNTABLY-INFINITE
        example_subject_type: qudt_CardinalityType
    - object:
        example_object: A datatype that is the union of numeric xsd data types. "numericUnion"
          is equivalent to the xsd specification that uses an xsd:union of memberTypes="xsd:decimal
          xsd:double xsd:float xsd:integer".
        example_object_type: string
        example_predicate: dct:description
        example_subject: qudt:valueUnion
        example_subject_type: rdfs_Datatype
    - object:
        example_object: QUDT is a non-profit organization that governs the QUDT ontologies.
        example_object_type: rdf_HTML
        example_predicate: dct:description
        example_subject: vaem:#QUDT
        example_subject_type: vaem_#Party
