    description: 'The "qudt:id" is an identifier string that uniquely identifies a
      QUDT concept.  The identifier is constructed using a prefix. For example, units
      are coded using the pattern: "UCCCENNNN", where "CCC" is a numeric code or a
      category and "NNNN" is a digit string for a member element of that category.
      For scaled units there may be an addition field that has the format "QNN" where
      "NN" is a digit string representing an exponent power, and "Q" is a qualifier
      that indicates with the code "P" that the power is a positive decimal exponent,
      or the code "N" for a negative decimal exponent, or the code "B" for binary
      positive exponents.'
    domain: qudt_Concept
